import { Outlet } from 'react-router-dom';
import Header from '../components/commons/Header';
import Navbar from '../components/commons/Navbar';

function Layout() {

	return (
		<div>
			<Header />
			<Navbar />
			<Outlet />
		</div>
	);
}

export default Layout;
